import './Control.css';
import React, { useRef, useState } from 'react';
import RecordAudio from '../../RecordAudio/RecordAudio'
import ConfirmationModal from '../../ConfirmationModal/ConfirmationModal'
import { NotificationManager } from 'react-notifications';
import { sentCodes, msgsCode } from '../../codes'
import { postAudioMsg, postMsg } from '../../Api/Api'

function Control({ msgs, setMsgs, port }) {
    const recordAudioRef = useRef(null);
    const confirmationModalRef = useRef(null);
    const [confirmationMsgCode, setConfirmationMsgCode] = useState(null)
    
    var onMsgIconClick = (code) => {
        setConfirmationMsgCode(code.toString(10))
        confirmationModalRef.current.openModal();
    }

    var onSendMsg = () => {
        NotificationManager.info(sentCodes[confirmationMsgCode] + " message will be sent to Command Center")
        var data = {
            Code: parseInt(confirmationMsgCode)
        };
        postMsg(data, port);
        const msg = {
            Code: confirmationMsgCode,
            sent: true
        };
        setMsgs((msgs)=> {
            return [...msgs, msg]
        })
    }

    var onSendAudio = (audio) => {
        NotificationManager.info("Your audio message will be sent to Command Center")
        postAudioMsg(audio, port);
    }

    return (
        <div className="control-container">
            <ConfirmationModal onSend={onSendMsg} msgCode={confirmationMsgCode} name={"Command Center"} ref={confirmationModalRef} > </ConfirmationModal>  
            <RecordAudio onSend={onSendAudio} ref={recordAudioRef}></RecordAudio>
            <div data-augmented-ui="tr-clip br-clip bl-clip-y border" class="control-item"></div>
            <img alt="record-audio" onClick = {() => {recordAudioRef.current.openModal()}} className="audio-icon" src="data:image/svg+xml;base64," />            
            <img alt="Danger" onClick={() => onMsgIconClick(msgsCode["Danger"])} className="danger-icon" src="data:image/svg+xml;base64," />
            <img alt="Mission Accomplished" onClick={() => onMsgIconClick(msgsCode["Mission Accomplished"])} className="mission-icon" src="data:image/svg+xml;base64," />
            <img alt="Need Backup" onClick={() => onMsgIconClick(msgsCode["Need Backup"])} className="backup-icon" src="data:image/svg+xml;base64," />
            <img alt="Change Plan" onClick={() => onMsgIconClick(msgsCode["Change Plan"])} className="plan-icon" src="data:image/svg+xml;base64," />
            <svg className="ctrl-svg" version="1.1" id="Layer_1" xmlns="http://www.w3.org/2000/svg" x="0px" y="0px"
                viewBox="0 0 1000 1000" styles="enable-background:new 0 0 1000 1000;" space="preserve">
                <circle class="st0" cx="500" cy="500" r="302.8">
                    <animateTransform attributeType="xml"
                        attributeName="transform"
                        type="rotate"
                        from="0 500 500"
                        to="360 500 500"
                        dur="100s"
                        repeatCount="indefinite" />
                </circle>
                <circle class="st1" cx="500" cy="500" r="237.7">
                    <animateTransform attributeType="xml"
                        attributeName="transform"
                        type="rotate"
                        from="0 500 500"
                        to="360 500 500"
                        dur="40s"
                        repeatCount="indefinite" />
                </circle>
                <circle class="st2" cx="500" cy="500" r="366.8" transform="rotate(0 500 500)">
                    <animateTransform attributeType="xml"
                        attributeName="transform"
                        type="rotate"
                        from="0 500 500"
                        to="-360 500 500"
                        dur="50s"
                        repeatCount="indefinite" />
                </circle>
                <circle class="st3" cx="500" cy="500" r="385.1" />
            </svg> 
        </div>
    );
}
export default Control;
